Given the code snippet below, what will be the output of the two printf statements and why?  
```java  
public class Stuff {  
  public int value;  
}  
Stuff things = new Stuff();  
int x;  
System.out.printf("%d%n", things.value);  
System.out.printf("%d%n", x);  
```

