Given the performance goal of minimizing temporary String objects, which version is the best design choice, and why?

```java
String build1(String[] parts) {
    String s = "";
    for (String p : parts) s += p;
    return s;
}

String build2(String[] parts) {
    StringBuilder sb = new StringBuilder();
    for (String p : parts) sb.append(p);
    return sb.toString();
}

String build3(String[] parts) {
    String s = "";
    for (String p : parts) s = s.concat(p);
    return s;
}

String build4(String[] parts) {
    String s = "";
    for (String p : parts) s += p.intern();
    return s;
}
```

